import React from 'react';
import { BrowserRouter as Router,  } from "react-router-dom";

import './App.css';

import About from './components/About'
import Portfolio from './components/Portfolio';



function App() {

	return (
		<Router>
			<About />
			<Portfolio />
		</Router>
	);

}

export default App;
